import React from "react";

import { HomeCarousel } from "./pages/homepagecarousel";
import { Survey } from "./pages/initialsurvey";

export function Router(page){
    switch(page){
        case 'HomeCarousel':
            return <HomeCarousel />
        case 'Survey':
            return <Survey />
        default:
            return <HomeCarousel />
    }
}
